package com.fsc.external.portal.dtos.publicregisterdetailedinfo;

public class PublicRegisterDocsDto {

    private String documentTypeNameLong;
    private String documentDate;
    private String documentNumber;
    private String osnovanie;

    public String getDocumentTypeNameLong() {
        return documentTypeNameLong;
    }

    public void setDocumentTypeNameLong(String documentTypeNameLong) {
        this.documentTypeNameLong = documentTypeNameLong;
    }

    public String getDocumentDate() {
        return documentDate;
    }

    public void setDocumentDate(String documentDate) {
        this.documentDate = documentDate;
    }

    public String getDocumentNumber() {
        return documentNumber;
    }

    public void setDocumentNumber(String documentNumber) {
        this.documentNumber = documentNumber;
    }

    public String getOsnovanie() {
        return osnovanie;
    }

    public void setOsnovanie(String osnovanie) {
        this.osnovanie = osnovanie;
    }
}
